01145         public bool Update()
01146         {
01147             // Console.WriteLine("This note has bpm note number of " + this.BPMChangeNotes.Count());
01148             bool result = false;
01149             this.tickStamp = this.bar * 384 + this.tick;
01150             while (this.tick >= 384)
01151             {
01152                 this.tick -= 384;
01153                 this.bar++;
01154             }
01155             // string noteInformation = "This note is "+this.NoteType+", in tick "+ this.tickStamp+", ";
01156             //this.tickTimeStamp = this.GetTimeStamp(this.tickStamp);
01157             this.waitTickStamp = this.tickStamp + this.waitLength;
01158             //this.waitTimeStamp = this.GetTimeStamp(this.waitTickStamp);
01159             this.lastTickStamp = this.waitTickStamp + this.lastLength;
01160             //this.lastTimeStamp = this.GetTimeStamp(this.lastTickStamp);
01161             if (!(this.NoteType.Equals("SLIDE") || this.NoteType.Equals("HOLD")))
01162             {
01163                 result = true;
01164             }
01165             else if (this.calculatedLastTime > 0 && this.calculatedWaitTime > 0)
01166             {
01167                 result = true;
01168             }
01169             return result;
01170         }
