01197         public string GenerateAppropriateLength(int length)
01198         {
01199             string result = "";
01200             const int definition = 384;
01201             int divisor = GCD(definition, length);
01202             int quaver = definition / divisor, beat = length / divisor;
01203             result = "[" + quaver.ToString() + ":" + beat.ToString() + "]";
01204             return result;
01205         }
