01224         public string GenerateAppropriateLength(int length, double bpm)
01225         {
01226             string result = "";
01227             switch (this.NoteGenre)
01228             {
01229                 case "SLIDE":
01230                     double sustain = this.WaitTimeStamp - this.TickTimeStamp;
01231                     double duration = this.LastTimeStamp - this.WaitTimeStamp;
01232                     result = "[" + sustain + "##" + duration + "]";
01233                     break;
01234                 case "HOLD":
01235                     double startTime = this.TickTimeStamp;
01236                     duration = this.LastTimeStamp - this.TickTimeStamp;
01237                     result = "[" + startTime + "##" + duration + "]";
01238                     break;
01239             }
01240             return result;
01241         }
