01254         public double GetTimeStamp(int overallTick)
01255         {
01256             double result = 0.0;
01257             if (overallTick != 0)
01258             {
01259                 int maximumBPMIndex = 0;
01260                 for (int i = 0; i < this.bpmChangeNotes.Count; i++)
01261                 {
01262                     if (this.bpmChangeNotes[i].TickStamp <= overallTick)
01263                     {
01264                         maximumBPMIndex = i;
01265                     }
01266                 }
01267                 if (maximumBPMIndex == 0)
01268                 {
01269                     result = GetBPMTimeUnit(this.bpmChangeNotes[0].BPM) * overallTick;
01270                 }
01271                 else
01272                 {
01273                     for (int i = 1; i <= maximumBPMIndex; i++)
01274                     {
01275                         double previousTickTimeUnit = GetBPMTimeUnit(this.bpmChangeNotes[i - 1].BPM);
01276                         result += (this.bpmChangeNotes[i].TickStamp - this.bpmChangeNotes[i - 1].TickStamp) * previousTickTimeUnit;
01277                     }
01278                     double tickTimeUnit = GetBPMTimeUnit(this.bpmChangeNotes[maximumBPMIndex].BPM);
01279                     result += (overallTick - this.bpmChangeNotes[maximumBPMIndex].TickStamp) * tickTimeUnit;
01280                 }
01281             } //A serious improvement is needed for this method
01282             return result;
01283         }
